import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Home, Building2, Search, MapPin } from 'lucide-react';

const HomePage: React.FC = () => {
  const navigate = useNavigate();
  const [searchData, setSearchData] = useState({
    propertyType: '',
    minPrice: '',
    maxPrice: '',
    city: ''
  });

  const handleSearch = (e: React.FormEvent) => {
    e.preventDefault();
    const params = new URLSearchParams();
    Object.entries(searchData).forEach(([key, value]) => {
      if (value) params.append(key, value);
    });
    navigate(`/search?${params.toString()}`);
  };

  const handleInputChange = (field: string, value: string) => {
    setSearchData(prev => ({
      ...prev,
      [field]: value
    }));
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-primary-500 to-primary-600">
      {/* Header */}
      <div className="container mx-auto px-4 py-6">
        <div className="flex justify-between items-center">
          {/* Logo */}
          <div className="flex items-center space-x-2">
            <div className="w-8 h-8 bg-primary-500 rounded-lg flex items-center justify-center">
              <Home className="w-5 h-5 text-white" />
            </div>
            <span className="text-2xl font-bold text-secondary-700">224 Suite</span>
          </div>
          
          {/* Navigation */}
          <div className="flex space-x-4">
            <button 
              onClick={() => navigate('/register')}
              className="text-secondary-700 hover:text-secondary-800 font-medium"
            >
              S'inscrire
            </button>
            <button 
              onClick={() => navigate('/login')}
              className="text-secondary-700 hover:text-secondary-800 font-medium"
            >
              Se connecter
            </button>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="container mx-auto px-4 py-12">
        <div className="max-w-6xl mx-auto">
          {/* Hero Section */}
          <div className="text-center mb-12">
            <h1 className="text-4xl md:text-5xl font-bold text-secondary-700 mb-6">
              Trouvez votre chez-vous en un clic.
            </h1>
          </div>

          {/* Search Bar */}
          <div className="card mb-16">
            <form onSubmit={handleSearch} className="search-bar">
              <div className="flex-1">
                <input
                  type="text"
                  placeholder="Type de bien"
                  value={searchData.propertyType}
                  onChange={(e) => handleInputChange('propertyType', e.target.value)}
                  className="input-field"
                />
              </div>
              <div className="flex-1">
                <input
                  type="number"
                  placeholder="Prix min."
                  value={searchData.minPrice}
                  onChange={(e) => handleInputChange('minPrice', e.target.value)}
                  className="input-field"
                />
              </div>
              <div className="flex-1">
                <input
                  type="number"
                  placeholder="Prix max."
                  value={searchData.maxPrice}
                  onChange={(e) => handleInputChange('maxPrice', e.target.value)}
                  className="input-field"
                />
              </div>
              <div className="flex-1">
                <input
                  type="text"
                  placeholder="Ville"
                  value={searchData.city}
                  onChange={(e) => handleInputChange('city', e.target.value)}
                  className="input-field"
                />
              </div>
              <button type="submit" className="btn-secondary px-8">
                Rechercher
              </button>
            </form>
          </div>

          {/* User Types Section */}
          <div className="grid md:grid-cols-3 gap-8">
            {/* Propriétaires */}
            <div className="card p-6 text-center">
              <div className="w-16 h-16 bg-primary-500 rounded-full flex items-center justify-center mx-auto mb-4">
                <Home className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-secondary-700 mb-2">
                Propriétaires
              </h3>
              <p className="text-gray-600">
                Publiez vos annonces de location ou de vente
              </p>
            </div>

            {/* Agences Immobilières */}
            <div className="card p-6 text-center">
              <div className="w-16 h-16 bg-secondary-500 rounded-full flex items-center justify-center mx-auto mb-4">
                <Building2 className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-secondary-700 mb-2">
                Agences Immobilières
              </h3>
              <p className="text-gray-600">
                Créez un profil pour votre agence et ajoutez vos biens
              </p>
            </div>

            {/* Chercheurs de maison */}
            <div className="card p-6 text-center">
              <div className="w-16 h-16 bg-secondary-500 rounded-full flex items-center justify-center mx-auto mb-4">
                <Search className="w-8 h-8 text-white" />
              </div>
              <h3 className="text-xl font-bold text-secondary-700 mb-2">
                Chercheurs de maison
              </h3>
              <p className="text-gray-600">
                Recherchez et trouvez des maisons à louer ou à vendre
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
